import React from 'react';
import Navbar from './Navbar';
import Footern from './footer/Footern';

const colors = {
  darkBlue: '#022b3a',
  blue: '#1f7a8c',
  lightBlue: '#bfdbf7',
  paleBlue: '#e1e5f2',
  white: '#ffffff',
};

function App() {
  return (
    <div className="flex flex-col min-h-screen" style={{ background: colors.paleBlue }}>
      <Navbar />
      <main style={{ minHeight: '60vh', background: colors.paleBlue }}></main>
      <Footern />
    </div>
  );
}

export default App;
